import React from 'react';
import Welcome from './WelcomeComponent'
import RangeOfServices from './RangeOfServices'
import WatchOurVideo from './WatchOurVideo'
import BookSession from './BookSession'
import FullScreenInfo from '../FullScreenInfo'

import ProrideImg1 from '../../static/images'

// const removeSpaces = (str) => {
//   return str.replace(/[()\s+]/g,'')
// }

function Home() {
  return (
    <div>
      <FullScreenInfo classes="blue-gradient full-screen-info" title="ProRide Coaching" description="Making cycling in school fun" buttonText="button" imageDescription="phil bateman coaching in schools" imageSrc="data:image/jpeg;base64," />

      <RangeOfServices />

      <div class='home-divider'>
        <div class='row'>
          <div class='column'>
            <div class='video-div'>
             <WatchOurVideo />
            </div>
          </div>
          <div class='column'>
            <div class='book-session-div'>
             <BookSession />
            </div>
          </div>
        </div>
      </div>


      <FullScreenInfo classes="blue-gradient full-screen-info" title="Title" description="Ipsum Cortum Verellium" buttonText="button" imageDescription="image description" imageSrc="data:image/jpeg;base64," />
    </div>
  );
}

export default Home;
